class Solution {
public:
    int findMaxConsecutiveOnes(vector<int>& nums) {
        int max_l = 0;
        int n = (int)nums.size();
        int temp = max_l;
        for (int i = 0; i < n; ++i) {
            if (nums[i] == 1) {
                max_l ++;
            } else {
                temp = max(max_l, temp);
                max_l = 0;
            }
        }
        return max_l = max(max_l, temp);
    }
    
};
